    <style>
        body {
            background-color: black;
            color: white;
            font-family: 'Poppins', sans-serif;
            padding: 20px;
            font-size: medium;
        }
        a {
            color: white;
            font-size: 1.2rem;
            text-decoration: none;
        }
        .log-title {
            text-align: center;
            margin: 20px 0;
            color: white;
            font-family: 'Poppins', sans-serif;
        }
        .log-container {
            overflow: hidden;
            height: 60vh; /* Altura fixa para o contÃªiner */
            position: relative;
            background-color: #111;
            border: 2px solid #333;
            box-shadow: 0 0 10px #00ff00;
        }
        .log-content {
            position: absolute;
            width: 100%;
            animation: scroll 100s linear infinite;
        }
        .log-line {
            color: #00ff00;
            margin: 0;
            padding: 10px;
            white-space: nowrap;
        }

        @keyframes scroll {
            0% {
                transform: translateY(0);
            }
            100% {
                transform: translateY(-1000%); /* Ajustar para a quantidade de texto */
            }
        }
    </style>
</head>
